import { FC, useEffect } from 'react'
import Navigation from '../components/Navigation'
import Api from '../api/Api'

const Index: FC = () => {

    useEffect(() => {
        const fetch = () => {
            const api = new Api({ message: "Hello" })
            api.index()
        }
        fetch()
    })

    return (
        <>
            <Navigation />
            <div className="App">
                <h1>Index</h1>
            </ div>
        </>
    )
}

export default Index
